import ExpenseItem from "./ExpenseItem";


const ExpensesList = (props) => {
    return( <div>
        {props.items.length === 0 ? <p>Ne expenses found.</p> : 
        props.items.map((expenses) => (
          <ExpenseItem
            key={expenses.id}
            title={expenses.title}
            amount={expenses.amount}
            date={expenses.date}
          />
        ))}
        </div>
      )
};

export default ExpensesList;
